import React from 'react'
import "./AboutPage.css";
import Navbar from "../components/Navbar";

function AboutPage() {
    return (
        <section className="container-relative">
            <div className="container-fluid mx-auto">
                <Navbar />
                <h1>About page</h1>
            </div>
        </section>
    )
}

export default AboutPage
